[{"location":"DeBoer/#DeBoer-Model-1","page":"DeBoer","title":"DeBoer Model","text":"","category":"section"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"DeBoer, R. W., Karemaker, J. M., & Strackee, J. (1987). Hemodynamic fluctuations and baroreflex sensitivity in humans: a beat-to-beat model. American Journal of Physiology-Heart and Circulatory Physiology, 253(3), H680-H689. ([DOI][deb87])","category":"page"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"[deb87]: https://doi.org/10.1152/ajpheart.1987.253.3.H680","category":"page"},{"location":"DeBoer/#Theory-1","page":"DeBoer","title":"Theory","text":"","category":"section"},{"location":"DeBoer/#Effective-pressure:-1","page":"DeBoer","title":"Effective pressure:","text":"","category":"section"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"The systolic pressure is transformed to be in accordance with the sigmoid-shaped activation curve of the baroreflex. The constant S_0 defines the working point.","category":"page"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"S_n^star = f(S_n)hspace5mmtextwith hspace5mm f(S_n) = S_0 + 18textatanleft(fracS_n -S_0 18right)","category":"page"},{"location":"DeBoer/#Baroreflex-on-Heart-Rate-1","page":"DeBoer","title":"Baroreflex on Heart Rate","text":"","category":"section"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"The transfer function G_a(z) relates the effective systolic pressure to the RR interval. It models fast vagally mediated and slower, sympathetic, baroreflex effects.","category":"page"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"I_n = G_a (z) S_n^star","category":"page"},{"location":"DeBoer/#Baroreflex-on-Peripheral-Resistance-1","page":"DeBoer","title":"Baroreflex on Peripheral Resistance","text":"","category":"section"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"The peripheral resistance is influenced by the baroreflex mediated through the sympathetic nervous system reflected in the transfer function G_b(z). T_0 is an empirical offset constant (around 3000 ms).","category":"page"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"T_ n  = R_n C = T_ 0  + G_b(z)S_n^star","category":"page"},{"location":"DeBoer/#Properties-of-Myocardium-and-Respiration-1","page":"DeBoer","title":"Properties of Myocardium & Respiration","text":"","category":"section"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"Starling's law governs the pulse pressure through the coupling constant gamma. Respiration also enters through the pulse pressure, modeled as a sine. ","category":"page"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"P_ n  = gamma I_n  + A_rhosin(2pi f_rho t) hspace5mm textwith hspace5mm t = sum I_n","category":"page"},{"location":"DeBoer/#Windkessel-1","page":"DeBoer","title":"Windkessel","text":"","category":"section"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"Diastolic pressure is derived from the two-element Windkessel model.","category":"page"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"D_ n  = S_n exp left( - fracI_n T_n  right)","category":"page"},{"location":"DeBoer/#Time-Propagation-1","page":"DeBoer","title":"Time Propagation","text":"","category":"section"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"The next beat is calculated through the standard relation:","category":"page"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"S_n+1 = P_n + D_n","category":"page"},{"location":"DeBoer/#Usage-1","page":"DeBoer","title":"Usage","text":"","category":"section"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"DeBoerModel","category":"page"},{"location":"DeBoer/#CardioModels.DeBoerModel","page":"DeBoer","title":"CardioModels.DeBoerModel","text":"DeBoerModel()\n\nA simple structure that stores a DeBoer-model. \n\nThe default initialization was taken from the original paper. When constructiong the model, single properties can be defined as keyword arguments.  The model has a state, if it was already used in predict!, otherwise a default is provided in predict or predict!.\n\nExamples\n\njulia> model = DeBoerModel()\nDeBoerModel\n  a0: Int64 9\n  ak: Array{Int64}((6,)) [0, 1, 2, 3, 2, 1]\n  c1: Int64 -1360\n  bk: Array{Int64}((6,)) [0, 2, 4, 6, 4, 2]\n  TStar: Int64 3585\n  γ: Float64 0.016\n  c2: Float64 32.2\n  c3: Float64 1.0957070684897647\n  A: Int64 3\n  fresp: Float64 0.3\n  resp: #30 (function of type Main.CardioModels.var\"#30#36\"{Int64, Float64})\n  noiseI: Distributions.Normal{Float64}\n  noiseS: Distributions.Normal{Float64}\n  operationPoint: Int64 120\n  F: #31 (function of type Main.CardioModels.var\"#31#37\"{Int64})\n  hasState: Bool false\n  S: Nothing nothing\n  Seff: Nothing nothing\n  D: Nothing nothing\n  I: Nothing nothing\n  T: Nothing nothing\n  ρ: Nothing nothing\n  time: Int64 0\n\n\n\n\n\n","category":"type"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"predict(::DeBoerModel, ::Int)","category":"page"},{"location":"DeBoer/#CardioModels.predict-Tuple{DeBoerModel, Int64}","page":"DeBoer","title":"CardioModels.predict","text":"predict(model::DeBoerModel, n::Int; burnIn::Int = 0)\n\nPredicts 'N' values of the cardiovascular variables for the respective model. With 'burnIn' a certain number af values can be dropped in the beginning.\n\nExamples\n\njulia  julia> S, D, I, T, ρ = predict(model, 100)    (S = [...], D = [...], I = [...], T = [...], ρ = [...])\n\n\n\n\n\n","category":"method"},{"location":"DeBoer/#","page":"DeBoer","title":"DeBoer","text":"predict!(::DeBoerModel, ::Int)","category":"page"},{"location":"DeBoer/#CardioModels.predict!-Tuple{DeBoerModel, Int64}","page":"DeBoer","title":"CardioModels.predict!","text":"predict!(model::DeBoerModel, n::Int; burnIn::Int = 0)\n\nPredicts 'N' values of the cardiovascular variables for the respective model and updates its state. With 'burnIn' a certain number af values can be dropped in the beginning.\n\nExamples\n\njulia  julia> S, D, I, T, ρ = predict(model, 100)   (S = [...], D = [...], I = [...], T = [...], ρ = [...])   julia> model.hasState  true\n\n\n\n\n\n","category":"method"},{"location":"Baselli/#Baselli-Model-1","page":"Baselli","title":"Baselli Model","text":"","category":"section"},{"location":"Baselli/#","page":"Baselli","title":"Baselli","text":"The model is defined through the following three equations, where G denotes an all-zero and M an all-pole transfer function:","category":"page"},{"location":"Baselli/#","page":"Baselli","title":"Baselli","text":"S_n = G_S S(z) S_n quad + quad G_SI(z)I_n quad  + quad G_Srho(z) rho_n  quad  + quad  M_S(z) w_S","category":"page"},{"location":"Baselli/#","page":"Baselli","title":"Baselli","text":"I_n = G_IS(z)S_n quad  + hspace40mm  G_Irho(z) rho_n quad  + quad  M_I(z) w_I","category":"page"},{"location":"Baselli/#","page":"Baselli","title":"Baselli","text":"rho_n = hspace104mmM_rho(z) w_rho","category":"page"},{"location":"Baselli/#","page":"Baselli","title":"Baselli","text":"$","category":"page"},{"location":"Baselli/#","page":"Baselli","title":"Baselli","text":"\\begin{aligned} Sn &= G{SS}(z)Sn \\quad + \\quad G{SI}(z)In \\quad  + \\quad G{S\\rho}(z) \\rhon  \\quad  + \\quad  M{S}(z) w{S} \\\nIn &= G{IS}(z)Sn \\quad  + \\hspace{29mm}  G{I\\rho}(z) \\rhon \\quad  + \\quad  M{I}(z) w{I}\\\n\\rhon &= \\hspace{76mm}M{\\rho}(z) w_{\\rho} \\end{aligned} $ It can be identified from data as an ARXAR-model using the generalized least squares method.","category":"page"},{"location":"Karemaker/#Karemaker-Model-1","page":"Karemaker","title":"Karemaker Model","text":"","category":"section"},{"location":"Karemaker/#","page":"Karemaker","title":"Karemaker","text":"A main feature of the model is that besides parasympathetic action through the baroreflex, sympathetic action is added. Sympathetic activity is triggered if the diastolic pressure falls below a reference value and influences heart rate, inotropy, and systemic resistance with some delay. In this way, a 0.1Hz oscillation is induced.","category":"page"},{"location":"Karemaker/#Sympathetic-activation-1","page":"Karemaker","title":"Sympathetic activation","text":"","category":"section"},{"location":"Karemaker/#","page":"Karemaker","title":"Karemaker","text":"SympD_n = 0 hspace5mm textif hspace22mm D_n  D_textref","category":"page"},{"location":"Karemaker/#","page":"Karemaker","title":"Karemaker","text":"SympD_n = D_textref - D_n hspace5mm textif hspace5mm D_n leq D_textref","category":"page"},{"location":"Karemaker/#","page":"Karemaker","title":"Karemaker","text":"Symp_n = textatan left(G_SA(z) cdot SympD_nright)","category":"page"},{"location":"Karemaker/#Baroreflex-1","page":"Karemaker","title":"Baroreflex","text":"","category":"section"},{"location":"Karemaker/#","page":"Karemaker","title":"Karemaker","text":"I_n^star = a_1 S_n-1 + I_0 + w_I + A_rho^Isin(2pi f_rhot + phi) hspace5mm textif hspace5mmI_n-1  700 ms","category":"page"},{"location":"Karemaker/#","page":"Karemaker","title":"Karemaker","text":"I_n^star = a_2 S_n-2 + I_0 + w_I + A_rho^Isin(2pi f_rhot + phi) hspace5mm textif hspace5mmI_n-1 leq 700 ms","category":"page"},{"location":"Karemaker/#","page":"Karemaker","title":"Karemaker","text":"I_n = fracI_n^star1 + beta Symp_n","category":"page"},{"location":"Karemaker/#","page":"Karemaker","title":"Karemaker","text":"with beta the sympathetic 'force' on I","category":"page"},{"location":"Karemaker/#-1","page":"Karemaker","title":"","text":"","category":"section"},{"location":"Karemaker/#","page":"Karemaker","title":"Karemaker","text":"D_n = S_n expleft(frac-I_n R C (1 + delta Symp_n)right)","category":"page"},{"location":"Karemaker/#","page":"Karemaker","title":"Karemaker","text":"with RC the diastolic runoff and delta the sympathetic 'force' on D","category":"page"},{"location":"Karemaker/#Starling/Restitution-1","page":"Karemaker","title":"Starling/Restitution","text":"","category":"section"},{"location":"Karemaker/#","page":"Karemaker","title":"Karemaker","text":"P_n = (gamma I_n + P_0)(1+ varepsilon Symp_n) + w_P + A_rho^Psin(2pi f_rhot + phi)","category":"page"},{"location":"Karemaker/#","page":"Karemaker","title":"Karemaker","text":"with varepsilon the sympathetic 'force' on P (inotropy by symathetics and respiratory BP modulation) \nThe next systole is determined by S_n+1 = D_n + P_n ","category":"page"},{"location":"#CardioModels-1","page":"General","title":"CardioModels","text":"","category":"section"},{"location":"#Notation-1","page":"General","title":"Notation","text":"","category":"section"},{"location":"#","page":"General","title":"General","text":"The following convention is used for cardiovascular variables:","category":"page"},{"location":"#","page":"General","title":"General","text":"I:  RR Intrval series\nS:  Systolic blood pressure\nD:  Diastolic blood pressure\nP:  Pulse Pressure\n<a href=\"https://www.codecogs.com/eqnedit.php?latex=\\rho\" target=\"_blank\"><img src=\"https://latex.codecogs.com/gif.latex?\\rho\" title=\"\\rho\" /></a>:   Respiration\nT: Time constant as a measure of peripheral resistance R","category":"page"},{"location":"#","page":"General","title":"General","text":"The relation between different variables is shown in the below figure: (Image: Notation and relation of cardiovascular variables)","category":"page"}]
